import icon from './icon.png';
import {Link} from "react-router-dom";
import React, { useEffect, useState } from "react";
import ReactDOM from 'react-dom'
import { FaHome, FaChild, FaHeartbeat, FaWind, FaTemperatureHigh } from 'react-icons/fa';
import fall from './fall.png';
import lean from './lean.png';
import run from './run.png';
import sit from './sit.png';
import stand from './stand.png';
import walk from './walk.png';

let user1_hr, user1_rp, user1_tp = 0;
let user2_hr, user2_rp, user2_tp = 0;
let user3_hr, user3_rp, user3_tp = 0;
let user4_hr, user4_rp, user4_tp = 0;
let user5_hr, user5_rp, user5_tp = 0;
let user6_hr, user6_rp, user6_tp = 0;
let user7_hr, user7_rp, user7_tp = 0;
let user8_hr, user8_rp, user8_tp = 0;
let user9_hr, user9_rp, user9_tp = 0;

const Section2 = () => {
    const [message, setMessage] = useState('');

    useEffect(() => {
        const WebSocket = require('ws');
        const socket = new window.WebSocket('ws://localhost:8080');

        socket.onmessage = (event) => {
          setMessage(event.data);
          const arr1 = event.data.split(",")
          const did = arr1[1]
          const hr = arr1[3]
          const rp = arr1[5]
          const tp = arr1[4]
          const action = arr1[7]

          console.log('did: '+did)
          console.log('hr: '+hr)
          console.log('rp: '+rp)
          console.log('tp: '+tp)

          if (did === '1'){
            user1_hr=hr;
            user1_rp=rp;
            user1_tp=tp;
          }
          else if (did === '2'){
            user2_hr=hr;
            user2_rp=rp;
            user2_tp=tp;
          }
          else if (did === '3'){
            user3_hr=hr;
            user3_rp=rp;
            user3_tp=tp;
          }
          else if (did === '4'){
            user4_hr=hr;
            user4_rp=rp;
            user4_tp=tp;
          }
          else if (did === '5'){
            user5_hr=hr;
            user5_rp=rp;
            user5_tp=tp;
          }
          else if (did === '6'){
            user6_hr=hr;
            user6_rp=rp;
            user6_tp=tp;
          }
          else if (did === '7'){
            user7_hr=hr;
            user7_rp=rp;
            user7_tp=tp;
          }
          else if (did === '8'){
            user8_hr=hr;
            user8_rp=rp;
            user8_tp=tp;
          }
          else if (did === '9'){
            user9_hr=hr;
            user9_rp=rp;
            user9_tp=tp;
          }

          if(action === '-3'){ //fall

          }
          else if(action === '-2'){ //stand

          }
          else{ //run

          }

        };
        return () => {
          if(socket.readyState===1){
            socket.close();
          }
        };
      }, []);

    return (
        <div className="section">
            <p>{message}</p>
            <div className="experience">
                <div>
                <div className="row1">
                <div className="square">
                <Link to={"/Detail1"}>
                    <div id="data" className="click">#1</div>
                    <img className="pic" id="action" src={fall} height="45px"/>
                    <div id="hr"><FaHeartbeat/> : {user1_hr}</div>
                    <div id="rp"><FaWind/> : {user1_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user1_tp}</div>
                </Link>              
                </div>  
                </div>
                <div className="row1">
                <div className="square">
                <Link to={"/Detail2"}>
                    <div id="data" className="click">#2</div><br/>
                    <img className="pic" src={lean} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> {user2_hr} </div>
                    <div id="rp"><FaWind/> {user2_rp} </div>
                    <div id="tp"><FaTemperatureHigh/> {user2_tp} </div>
                </Link>              
                </div>                 
                </div>
                <div className="row1">
                <div className="square">
                <Link to={"/Detail3"}>
                    <div id="data" className="click">#3</div><br/>
                    <img className="pic" src={walk} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user3_hr} </div>
                    <div id="rp"><FaWind/> : {user3_hr} </div>
                    <div id="tp"><FaTemperatureHigh/> : {user3_hr} </div>
                </Link>              
                </div>                  
                </div>
                </div>
                <div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail4"}>
                    <div id="data" className="click">#4</div><br/>
                    <img className="pic" src={run} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user4_hr}</div>
                    <div id="rp"><FaWind/> : {user4_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user4_tp}</div>
                </Link>              
                </div>                 
                </div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail5"}>
                    <div id="data" className="click">#5</div><br/>
                    <img className="pic" src={sit} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user5_hr}</div>
                    <div id="rp"><FaWind/> : {user5_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user5_tp}</div>
                </Link>              
                </div>           
                </div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail6"}>
                    <div id="data" className="click">#6</div><br/>
                    <img className="pic" src={stand} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user6_hr}</div>
                    <div id="rp"><FaWind/> : {user6_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user6_tp}</div>
                </Link>              
                </div>               
                </div>
                </div>

                <div>
                <div className="row3">
                <div className="square">
                <Link to={"/Detail7"}>
                    <div id="data" className="click">#7</div><br/>
                    <img className="pic" src={stand} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user7_hr}</div>
                    <div id="rp"><FaWind/> : {user7_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user7_tp}</div>
                </Link>              
                </div>                 
                </div>
                <div className="row3">
                <div className="square">
                <Link to={"/Detail8"}>
                    <div id="data" className="click">#8</div><br/>
                    <img className="pic" src={stand} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user8_hr}</div>
                    <div id="rp"><FaWind/> : {user8_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user8_tp}</div>
                </Link>              
                </div>             
                </div>
                <div className="row3">
                <div className="square">
                <Link to={"/Detail9"}>
                    <div id="data" className="click">#9</div><br/>
                    <img className="pic" src={stand} height="45px" alt="main"/>
                    <div id="hr"><FaHeartbeat/> : {user9_hr}</div>
                    <div id="rp"><FaWind/> : {user9_rp}</div>
                    <div id="tp"><FaTemperatureHigh/> : {user9_tp}</div>
                </Link>              
                </div>               
                </div>
                </div>
            </div>
        </div>
    )
}

export default Section2
